import React from "react";
import Chart from "../components/Chart/Chart.jsx";
import { Grid } from "@material-ui/core";
function Charts() {
  return (
    <div className="section">
      <h1>Charts</h1>
      <Grid
        container
        spacing={0}
        alignItems="center"
        justify="center"
        style={{ height: "60vh" }}
      >
        <Grid item xs={12} sm={4}>
          <Chart />
        </Grid>
        <Grid item xs={12} sm={4}>
          <Chart />
        </Grid>
        <Grid item xs={12} sm={3}>
          <Chart />
        </Grid>
      </Grid>
    </div>
  );
}

export default Charts;
